import React from "react";
import logo from "../img/logo.png";

const Navbar = () => {
  return (
    <nav className="flex items-center py-4 px-8 bg-gradient-to-b from-teal-700 to-teal-900 shadow-lg">
      {/* Logo on the right with a slight left margin */}
      <div className="text-white text-xl font-bold mr-auto">
        <img
          src={logo}
          alt="Logo"
          className="md:w-16 md:h-16 rounded-full bg-gray-300 p-4 shadow-lg"
        />
      </div>

      {/* Container for buttons on the left with a slight right margin */}
      <div className="flex space-x-4 ml-auto">
        <button className="text-white">الصفحة الرئيسية</button>
        <button className="text-white">تسجيل دخول</button>
        <button className="text-white">انشاء حساب</button>
        <select className="bg-white text-teal-600 px-2 py-1 rounded">
          <option>العربية</option>
          <option>English</option>
        </select>
      </div>
    </nav>
  );
};

export default Navbar;
